import React, { useEffect, useState } from "react";

export default function CustomHooks() {
  const [data, setData] = useState(""); // Déclarez useState au niveau supérieur du composant

  useEffect(() => {
    fetch("https://fakestoreapi.com/products")
      .then((response) => response.json()) // Extraction des données JSON
      .then((response) => {
        setData(response); // Mise à jour de l'état avec les données
      })
      .catch((error) => {
        console.error("Erreur lors de la récupération des produits :", error); // Gestion des erreurs
      });
  }, []); // Exécution une seule fois

  return (
    <div>
      <h1>Liste des produits :</h1>
      <ul>
        {data && Array.isArray(data) && data.map((product) => ( // Vérification des données
          <li key={product.id}>{product.title}</li>
        ))}
      </ul>
    </div>
  );
}
